import './Home.css';


const Home = () => {
    return (
        <div className="mx-auto col-xl-10 col-lg-11 col-md-11 col-sm-12">
            <div className="row  p-5 mb-5 bg-dark col-lg-12 col-sm-12 justify-content-center align-items-center">
              <div className="col-md-8">
                Lucie
              </div>
              <div className="offset-md-6"></div>
              <div className="col-md-4">
                Marc
              </div>
            </div>
            <div className="row offset-xl-1 p-5 bg-dark col-lg-12 col-sm-12 justify-content-center align-items-center">
              <div className="col-lg-8">
                Lucie
              </div>
              <div className="col-lg-4">
                Marc
              </div>
            </div>
        </div>
    );
}

export default Home;
